export default function SeparationLine({ type }) {
  if (type === 1)
    return (
      <div className="  h-[23px] lg:px-10 ">
        <img src="/Images/Line.png" alt="" className="h-full w-full" />
      </div>
    );

  if (type === 2)
    return (
      <div className="  h-[23px] lg:px-10 ">
        <img src="/Images/Line.png" alt="" className="h-full w-full" />
      </div>
    );
}
